  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:30.850810\",\n\t\"name\": \"lostwood-national-wildlife-refuge-annual-narrative-report-calendar-year-1983\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  NWR outlines Refuge accomplishments during the 1983 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses the management plan and research and investigations.
  Refuge administration is outlined; information about personnel, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, croplands, grasslands, grazing, fire management, pest control,
  and wilderness and special areas. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, raptors, game mammals, and animal control.
  The public uses of the Refuge described in this report include interpretive programs,
  recreational uses, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, major maintenance,
  equipment replacement, and energy conservation. Cooperative programs and items of
  interest are provided at the end. Photographs, newspaper articles, and brochures
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
